import React from 'react';

import * as S from './PlanetCardStyles';

const PlanetCard = ({ name, image }) => {
  return (
    <S.PlanetCard>
      <S.Image src={image} alt={`${name} landscape`} />
      <S.Name>{name}</S.Name>
    </S.PlanetCard>
  );
};

export default PlanetCard;
